description:
Nhà ở phố  Kim Mã có diện tích  31m, 6 tầng ,mặt tiền  4m, giá  4.5 tỷ Ba Đình Hà Nội 
Mô tả : 

💥LÔ GÓC GẦN MẶT PHỐ KIM MÃ, NGAY NGÃ BA SƠN TÂY - NGUYỄN THÁI HỌC - KIM MÃ.

💖 Ưu điểm là gần mặt phố, hình thửa vuông đẹp.

💖 Thiết kế và thi công khung cột chắc chắn trên lô góc 31m: 

- Tầng 1: Phòng khách;

- Tầng Lửng: Bếp + Hầm rượu;

- Tầng 2 : 1 ngủ to + 1 phòng xông hơi thư giãn;

- Tầng 3,4 : mỗi tầng 2 ngủ;

- Tầng 5: 1 ngủ + Sân Phơi;

- Tầng 6: tiểu cảnh, trồng rau nuôi Gà.

💖 Liên hệ Mr Dương để đi xem nhà và tư vấn 24/5
